export function Search() {


  const [listingData, setListingData] = useState(null);
  const [filters, setFilters] = useState([])

  useEffect( () => {

      axiosInstance
            .get(`listings/query/`, {

            })
            .then((res) => {
                setListingData(res.data)
            })
            .catch((err)=>{
                console.log(err)
            })
  }
)


