function onInputClick(e){
  e.preventDefault()
  e.stopPropagation()
}
//example search algorithm using lodash
function onChange(e) {
  const searchQuery = e.target.value
  if(searchQuery == '') {
    this.setState({dropdownOptions: defaultOpts})
    return
  }
  var r = _.filter(this.state.dropdownOptions, function(o) {
    return _.startsWith(_.lowerCase(o.text), _.lowerCase(searchQuery))
  });
  this.setState({dropdownOptions: r})
}

  return (
    <div>

    <Navbar/>


    <form className="d-flex" style={{ position: 'relative', top: '9px', width: '100%', left: '1%'}}>
      <input className="form-control me-2" type="search" style={{width: '400px', marginRight: '20px'}} placeholder="Enter an address, neigborhood, city, or ZIP code" aria-label="Search"/>
      <button className="btn btn-success" type="submit" style={{marginRight: '10px'}}>Search</button>
      <DropdownButton
          key="Success"
          id="dropdown-variants-Success"
          variant="success"
          title="Price"
          style= {{marginRight: '10px'}}
        >
          <Dropdown.Item eventKey="1" as="form">
            <input size="9" placeholder="min"/><input size="9" placeholder="max"/>
          </Dropdown.Item>
          <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
          <Dropdown.Item eventKey="3" active>
            Active Item
          </Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
        </DropdownButton>
        <DropdownButton
            key="Success"
            id="dropdown-variants-Success"
            variant="success"
            title="Beds & Bath"
            style= {{marginRight: '10px'}}
          >
            <Dropdown.Item eventKey="1">Action</Dropdown.Item>
            <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
            <Dropdown.Item eventKey="3" active>
              Active Item
            </Dropdown.Item>
            <Dropdown.Divider />
            <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
          </DropdownButton>
          <DropdownButton
              key="Success"
              id="dropdown-variants-Success"
              variant="success"
              title="More"
              style= {{marginRight: '10px'}}
            >
              <Dropdown.Item eventKey="1">Action</Dropdown.Item>
              <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
              <Dropdown.Item eventKey="3" active>
                Active Item
              </Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
            </DropdownButton>
          <button className="btn btn-danger" type="submit" style={{marginRight: '10px'}}>Create Alert</button>
          <a href="https://royaremlak.com/"><img src={royar} alt="royar" style={{width: '45px', height: '40px', position: 'absolute',left: '95%'}}/></a>
    </form>
    <div className="map-and-cards">

    <MapContainer/>

    <div style={containerStyle} className="cards-container">

      <div class="card-columns" style={{gridTemplateColumns: '350px 350px', display: 'grid', rowGap: '50px', columnGap: '18px'}}>

        <Cards listingData={listingData}/>

      </div>

    </div>

    </div>
    <ChatWidget/>
    </div>
  )

}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyBzFqVz_IYQJk4WLohrMjK0z508c7vtB_U'
})(Search);
